import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function ParttimeJob() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    qualification: "",
    isIndian: "yes",
    country: "",
    isStudent: "yes",
    college: "",
    collegeId: null,
    age: "",
    nightShift: "no",
    location: "",
    role: "",
    timing: "",
    salary: "",
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData({
      ...formData,
      [name]: files ? files[0] : value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Job Preferences:", formData);
    navigate("/jobresults", { state: formData });
  };

  return (
    <div className="form-container">
      <h2>Find Part-Time Jobs</h2>
      <form onSubmit={handleSubmit}>
        <label>Qualification:</label>
        <input
          type="text"
          name="qualification"
          value={formData.qualification}
          onChange={handleChange}
          required
        />

        <label>Are you Indian?</label>
        <select name="isIndian" value={formData.isIndian} onChange={handleChange}>
          <option value="yes">Yes</option>
          <option value="no">No</option>
        </select>

        {formData.isIndian === "no" && (
          <>
            <label>Country:</label>
            <input
              type="text"
              name="country"
              value={formData.country}
              onChange={handleChange}
              required
            />
          </>
        )}

        <label>Are you a student?</label>
        <select name="isStudent" value={formData.isStudent} onChange={handleChange}>
          <option value="yes">Yes</option>
          <option value="no">No</option>
        </select>

        {formData.isStudent === "yes" && (
          <>
            <label>College/University:</label>
            <input
              type="text"
              name="college"
              value={formData.college}
              onChange={handleChange}
              required
            />

            <label>Upload College/University ID:</label>
            <input type="file" name="collegeId" accept="image/*,.pdf" onChange={handleChange} />
          </>
        )}

        <label>Age:</label>
        <input
          type="number"
          name="age"
          value={formData.age}
          onChange={handleChange}
          required
        />

        <label>Comfortable with Night Shifts?</label>
        <select name="nightShift" value={formData.nightShift} onChange={handleChange}>
          <option value="no">No</option>
          <option value="yes">Yes</option>
        </select>

        <label>Preferred Job Location:</label>
        <input
          type="text"
          name="location"
          value={formData.location}
          onChange={handleChange}
          required
        />

        <label>Preferred Job Role:</label>
        <select name="role" value={formData.role} onChange={handleChange} required>
          <option value="">--Select a role--</option>
          <option value="Tutor">Tutor</option>
          <option value="Delivery">Delivery</option>
          <option value="Data Entry">Data Entry</option>
          <option value="Cafe Staff">Cafe Staff</option>
          <option value="Call Center">Call Center</option>
        </select>

        <label>Preferred Timing:</label>
        <input
          type="text"
          name="timing"
          value={formData.timing}
          onChange={handleChange}
          required
        />

        <label>Expected Salary:</label>
        <input
          type="text"
          name="salary"
          value={formData.salary}
          onChange={handleChange}
          required
        />

        <button type="submit">Find Jobs</button>
      </form>
    </div>
  );
}

export default ParttimeJob;
